ESSEXオリジナルのオーバルマフラーカッターです。<BR>
SUS304ステンレスでの仕上げも美しく手軽にリアのドレスアップができます。<BR>
取り付けも簡単でボルト3点止め＋バンドで止めるので、脱落の心配もありません。<BR>
防腐性もあり、仕上げにメッキ加工を施して熱での変色を起きにくくしてあります。<BR><BR>

画像3のシンメトリック・マフラーカッターステーと組み合わせて簡単にW出しマフラーを演出できます！<BR>
シンメトリック・マフラーカッターステーはこちら。
<hr>
